}

export default function Products(){
    let { slug } = useParams();
    let payload ={ slug : slug};
    api.api.post(`/admin/getproductsbycategory`, payload).then(products =>{
      console.log(products.data);
  }).catch(err =>{
    console.log(err);
  })
   
  return (
    <>
    
       <ProductContainer />
    </>
  );
}
